const WineList = ({ wines, selectWine }) => {
  return (
    <div class="col s12 m6 l3">
      <h2 class="center-align">Wines</h2>
      <div class="collection">
        {wines.map((wine) => (
          <a href="#!" class="collection-item" key={wine} onClick={() => selectWine(wine)}>
          {wine}
          </a>
        ))}
      </div>
    </div>

  )
}

export default WineList
